import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Contact from "./pages/Contact";
import About from "./pages/About";
import MyAccount from "./pages/MyAccount";
import CoursesPage from "./pages/CoursesPage";
import CourseDetailsPage from "./pages/CourseDetailsPage";
import InstructorDetailsPage from "./pages/InstructorDetailsPage";
// Add more pages later

function App() {

  const instructors = [
  {
    id: 1,
    name: "Edward Narton",
    title: "Developer and Teacher",
    students: 20,
    ratings: 720,
    bio: "Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod...",
    address: "North Helenavile, FV77 8WS",
    email: "info@edublink.com",
    phone: "+011235641",
    image: "/assets/instructor1.jpg",
    courseIds: [1, 2, 3, 4], // IDs of courses they teach
  },
  // Add more instructor objects...
];

  const courses = [
    {
      id: 1,
      title: "Starting SEO...",
      image:
        "https://demo.edublink.co/wp-content/uploads/2023/11/course-83-590x430.jpg",
      duration: "15 weeks",
      level: "Beginner",
      description: "Lorem ipsum...",
      rating: "5.0",
      lessons: "11",
      students: "227",
      oldPrice: "$35",
      price: "$30",
    },
    {
      id: 2,
      title: "Starting SEO...",
      image:
        "https://demo.edublink.co/wp-content/uploads/2023/11/course-83-590x430.jpg",
      duration: "15 weeks",
      level: "Beginner",
      description: "Lorem ipsum...",
      rating: "5.0",
      lessons: "11",
      students: "227",
      oldPrice: "$35",
      price: "$30",
    },
    // Add more course objects...
  ];
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/about" element={<About />} />
        <Route path="/my-account" element={<MyAccount />} />
        <Route path="/courses" element={<CoursesPage />} />
        <Route path="/courses" element={<CoursesPage courses={courses} />} />
        <Route path="/courses/:id" element={<CourseDetailsPage courses={courses} />} />
        <Route path="/instructors/:id" element={<InstructorDetailsPage instructors={instructors} courses={courses}/>} />
      </Routes>
    </Router>
  );
}
export default App;
